    return(
        <div>
            <p>BESTSELLERS</p>
            <div>
                <div></div>
                <div>
                    <p>helleborus</p>
                    <p>A delicate spring flower will give tenderness to your home.</p>
                    <div></div>
                    {/* <button>ADD TO CART</button> */}
                    <Button name={"Add"}/>
                </div>
            </div>
            <div></div>
            <div></div>
        </div>
    )
}
export default Bestseller;
